import React from "react";

function TimeTable({ data }) {
    let table = null;

    const returnDayName = (id) => {
        if (id === 1) {
            return 'Monday';
        }
        else if(id === 2) {
            return 'Tuesday';
        }
        else if(id === 3) {
            return 'Wednesday';
        }
        else if(id === 4) {
            return 'Thursday';
        }
        else if(id === 5) {
            return 'Friday';
        }
        else if(id === 6) {
            return 'Saturday';
        }
        else if(id === 7) {
            return 'Sunday';
        }
    }

    if (data != null && data.length > 0) {
        table = (
            <table>
                <tr>
                    <th>Day</th>
                    <th>Start Time</th>
                    <th>End Time</th>
                </tr>
                {data.map(item => {
                    return (
                        <tr key={item.dayId}>
                            <td>{returnDayName(item.dayId)}</td>
                            <td>{item.start}</td>
                            <td>{item.end}</td>
                        </tr>
                    );
                })}
            </table>
        );
    }

    return table;
}

export default TimeTable;
